    from PyQt5.QtCore import Qt
    from PyQt5.QtGui import QIcon,  QPixmap
    from PyQt5.QtWidgets import QApplication,  QWidget,  QVBoxLayout,  QHBoxLayout,  QToolButton
    class IconTestWidget(QWidget):
        def __init__(self,  parent=None):
            super().__init__(parent)
            self.initUI()
        def initUI(self):
            vbox = QVBoxLayout(self)
            hbox1 = QHBoxLayout()
            vbox.addLayout(hbox1)
            list1 = [['user_online_xpm', 'user_offline_xpm',  'playback_start_xpm',  'playback_stop_xpm', 'playback_pause_xpm'], 
                ['application_exit_xpm'], 
                ['arrow_left_xpm',  'arrow_right_xpm',  'arrow_up_xpm',  'arrow_down_xpm'], 
                 ['arrow_left_double_xpm',  'arrow_right_double_xpm',  'arrow_up_double_xpm',  'arrow_down_double_xpm']]
            self.addIcons(vbox,  list1)
            
            
        def addIcons(self, layout,  iconlist):
            for onerow in iconlist:
                hbox = QHBoxLayout()
                for iconname in onerow:
                    ic = globals()[iconname]
                    btn = QToolButton(); btn.setIcon( QIcon(QPixmap(ic)) ); btn.setToolTip(iconname)
                    hbox.addWidget(btn)
                layout.addLayout(hbox)
            
    qapp = QApplication([])
    w = IconTestWidget()
    w.show()
    qapp.exec_()
